import { useNavigate } from 'react-router-dom';
import logo from "../../Assets/logo.png"
import './Navbar.css';
import {Link} from "react-router-dom"

function Navbar(){
    const navigate = useNavigate();
    return <div className='Navbar'>
            <span><h2 className='h2Nav'>book</h2></span>
            <Link to="/">
                <img className="logo" src={logo} alt={logo}></img>
            </Link>
            <span><h2 className='h2Nav'>show</h2></span>
        <input className='NavSearch' type='text' placeholder='Search for Movies'/>
        <button className='Button' onClick={() => navigate("/Login")}>Log In</button>
        <button className='NavButton' onClick={() => navigate("/RegisterUser")}>Register</button>
    </div>
}

export default Navbar;
